class Solution:
    def findLongestWord(self, s: str, dictionary: [str]) -> str:
        res = ''
        for dic in dictionary:
            if self.isInDictionary(s, dic):
                if len(res) < len(dic):
                    res = dic
                elif len(res) == len(dic):
                    res = self.lexicOrder(res, dic)
        return res

    def isInDictionary(self, s, dic):
        slow = 0
        fast = 0
        while slow <= len(s)-1 and fast <= len(dic)-1:
            if dic[fast] == s[slow]:
                fast += 1
            slow += 1
        if fast == len(dic):
            return True
        else:
            return False

    def lexicOrder(self, s1, s2):
        for i in range(len(s1)):
            if s1[i] > s2[i]:
                return s2
            elif s1[i] < s2[i]:
                return s1
        return s1

